    "# This script assumes the 'dataframes' dictionary with the updated 'application_train' is available.\n",
    "\n",
    "app_train = dataframes['application_train']\n",
    "\n",
    "print(\"--- Analyzing Correlation of 'avg_days_late' with Target ---\")\n",
    "\n",
    "# Calculate the average payment lateness for each target group.\n",
    "# The .mean() function automatically ignores NaN values.\n",
    "feature_correlation = app_train.groupby('TARGET')['avg_days_late'].mean().reset_index()\n",
    "\n",
    "print(\"\\nAverage number of days late on previous payments by default status:\")\n",
    "print(feature_correlation)\n",
    "\n",
    "\n",
    "# --- Visualize the finding ---\n",
    "plt.figure(figsize=(10, 6))\n",
