    "import warnings\n",
    "import re # Import the regular expression library\n",
    "\n",
    "warnings.filterwarnings('ignore')\n",
    "\n",
    "# --- Load Full Datasets ---\n",
    "print(\"--- Loading Full Datasets for Final Model ---\")\n",
    "base_directory = r\"C:\\Users\\thist\\Downloads\\home-credit-default-risk\"\n",
    "app_train = pd.read_csv(f\"{base_directory}/application_train.csv\")\n",
    "bureau = pd.read_csv(f\"{base_directory}/bureau.csv\")\n",
    "prev_app = pd.read_csv(f\"{base_directory}/previous_application.csv\")\n",
    "\n",
    "# --- Comprehensive Feature Engineering ---\n",
    "print(\"\\nStarting comprehensive feature engineering...\")\n",
    "\n",
    "# 1. Feature Engineering from bureau.csv\n",
    "bureau_agg = bureau.groupby('SK_ID_CURR').agg({\n",
    "    'DAYS_CREDIT': ['mean', 'max', 'min'],\n",
    "    'CREDIT_DAY_OVERDUE': ['mean', 'max'],\n",
    "    'AMT_CREDIT_SUM': ['mean', 'sum']\n",
    "}).reset_index()\n",
    "bureau_agg.columns = ['_'.join(col).strip() for col in bureau_agg.columns.values]\n",
    "bureau_agg.rename(columns={'SK_ID_CURR_': 'SK_ID_CURR'}, inplace=True)\n",
    "app_train = pd.merge(app_train, bureau_agg, on='SK_ID_CURR', how='left')\n",
    "\n",
    "# 2. Feature Engineering from previous_application.csv\n",
    "prev_app_agg = prev_app.groupby('SK_ID_CURR').agg({\n",
    "    'AMT_ANNUITY': ['mean', 'max'],\n",
    "    'AMT_CREDIT': ['mean', 'max'],\n",
    "    'DAYS_DECISION': ['mean', 'min']\n",
    "}).reset_index()\n",
    "prev_app_agg.columns = ['_'.join(col).strip() for col in prev_app_agg.columns.values]\n",
    "prev_app_agg.rename(columns={'SK_ID_CURR_': 'SK_ID_CURR'}, inplace=True)\n",
    "app_train = pd.merge(app_train, prev_app_agg, on='SK_ID_CURR', how='left')\n",
    "\n",
    "# 3. Simple Domain Features from application_train.csv\n",
    "app_train['CREDIT_INCOME_PERCENT'] = app_train['AMT_CREDIT'] / app_train['AMT_INCOME_TOTAL']\n",
    "app_train['ANNUITY_INCOME_PERCENT'] = app_train['AMT_ANNUITY'] / app_train['AMT_INCOME_TOTAL']\n",
    "app_train['CREDIT_TERM'] = app_train['AMT_ANNUITY'] / app_train['AMT_CREDIT']\n",
    "app_train['DAYS_EMPLOYED_PERCENT'] = app_train['DAYS_EMPLOYED'] / app_train['DAYS_BIRTH']\n",
