    "import pandas as pd\n",
    "import shap\n",
    "import matplotlib.pyplot as plt\n",
    "\n",
    "# This script assumes you have already trained 'lgbm_final' and have the validation data 'X_val'\n",
    "\n",
    "print(\"\\n\" + \"=\"*80)\n",
    "print(\"--- Starting Feature Importance Analysis with SHAP ---\")\n",
    "\n",
    "# --- Create a SHAP explainer object ---\n",
    "explainer = shap.TreeExplainer(lgbm_final)\n",
    "\n",
    "# --- Calculate SHAP values for the validation set ---\n",
    "print(\"\\nCalculating SHAP values... (This may take a minute)\")\n",
    "shap_values = explainer(X_val)\n",
    "print(\"Calculation complete.\")\n",
    "\n",
    "# --- Create the SHAP Summary Plot ---\n",
    "print(\"\\nGenerating SHAP summary plot...\")\n",
    "plt.title('Feature Importance according to SHAP Values')\n",
    "\n",
    "# THE FIX: Simplify the call to use the 2D shap_values.values array directly.\n",
    "shap.summary_plot(shap_values.values, X_val, plot_type=\"bar\", show=False)\n",
    "\n",
    "plt.show()\n",
    "\n",
    "print(\"\\nSHAP analysis finished. A plot window should have opened.\")"
